import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import img from '../../assets/logo.png';

const Header = () => {
	return (
        <div className = 'homePageHeader'>
        <table className>
        <tbody>
        <tr>
          <td>

              <Link to="/">
                  <img src={img} alt = "Logo" style = {{ width:50, height:50, marginLeft: 1 + 'vw', marginTop: 3 + 'vh', float:'left'}} />
              </Link>
          </td>
          <td>
              <div>1APP AI</div>
          </td>

          <td style={{width:25 + '%', miWidth: 156}}>
              <Link to="/login">
                  <button className = "login-btn" style = {{float:'right', marginRight: 5 + 'vw'}}>Login</button>
              </Link>

          </td>

        </tr>
        </tbody>
      </table>

      </div>
	);
};

export default Header;
